import styles from './Button.module.css';
import React from 'react';

const Button = (props) => {
    const {isOutline,icon,text}=props;
    return (
        <div>
            <button className={`${isOutline ? styles.outline_btn : styles.primary_btn}`}>{icon}
                {text}
            </button>

        </div>
    )
}

export default Button
